import React from "react";
import PropTypes from "prop-types";

const ProfileItem = ({
	profile: {
		user: { _id, name, avatar },
		status,
		company,
		location,
		skills,
	},
}) => {
	return (
		<div>
			<h1>Profile Item</h1>
		</div>
	);
};

ProfileItem.propTypes = {};

export default ProfileItem;
